import React from "react";
import './MainPage.css';

const MainPage=()=>{
    return(
        <div className="mainpage">
            <div className="NavBar">
                <div className="StudentInfo">
                    <button>Edit Information</button>
                </div>
            </div>
        </div>
    )
}

export default MainPage;
